"id":"1247","type":"LabelSet"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 343.04 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 2047 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 40928.88 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 761.66 s &lt;/li&gt;\n&lt;li&gt; transfer time: 73.14 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://188.185.68.194:40506 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\nfrom dask import delayed\n\nfrom dask.distributed import performance_report, get_task_stream\n\nimport logging\nlogging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\nimport argparse\nparser = argparse.ArgumentParser()\nparser.add_argument(\"-c\", \"--cores\", type=int, default=4)\nparser.add_argument(\"-N\", \"--Nodes\", type=int, default=1)\nparser.add_argument(\"-f\", \"--files\", type=int, default=100)\nparser.add_argument(\"-p\", \"--pts\", type=int, default=400)\nparser.add_argument(\"-r\", \"--runs\", type=int, default=3)\nargs = parser.parse_args()\n\n#import pdb; pdb.set_trace()\n\ncluster = SLURMCluster(memory='{}g'.format(16*args.cores),\n                       processes=args.cores,\n                       cores=args.cores,\n                       queue='photon',\n                       #python='python',\n                       local_directory='/tmp/ikabadzh',\n                       header_skip=['-n 1', '-t 00:30:00'],\n                       job_extra=['--ntasks-per-node=1', '-t 8:00:00'])\n\n#import pdb; pdb.set_trace()\ncluster.scale(jobs=args.Nodes)\n#print(cluster.get_logs())\nclient = Client(cluster)\n\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\n\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\n        \"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\n        \"Dimuon_mass\",\n        \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\n        \"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    # Create canvas for plotting\n    ROOT.gStyle.SetOptStat(0)\n    ROOT.gStyle.SetTextFont(42)\n    c = ROOT.TCanvas(\"c\", \"\", 800, 700)\n    c.SetLogx()\n    c.SetLogy()\n\n    client.wait_for_workers(args.Nodes)\n    watch = ROOT.TStopwatch()\n    hist.GetValue() # triggers the event loop\n    elapsed = watch.RealTime()\n    file_out = open('../../distrdf_timestamps.out', 'a')\n    file_out.write(\"\\ncores={} Nodes={}: Event Loop={}s\\n\".format(args.cores, args.Nodes, elapsed))\n    file_out.close()\n\n    # Draw histogram\n    hist.GetXaxis().SetTitle(\"m_{#mu#mu} (GeV)\")
